import { Song } from "../App";

export const SongList = ({
  songs,
  index,
}: {
  songs: Song[];
  index: number;
}) => {
  return (
    <div className="song-list-container">
      <div style={{ width: "100%" }}>
        <ol>
          {songs.map((song, key) => (
            <a key={key}>
              <li
                className={
                  key === index
                    ? "song-list-item song-list-item-active"
                    : "song-list-item"
                }
              >
                {song.name}
              </li>
            </a>
          ))}
        </ol>
      </div>

      {/* <div
        style={{ display: "flex", flexDirection: "column", width: "50%" }}
      ></div> */}
    </div>
  );
};
